INSERT INTO `msw_page` VALUES (1,'x_frame_options','X-Frame-Options','Cross-Domain Controls','Disallows other sites from putting your site into an iframe','Set HTTP Response Header: \"X-Frame-Options: deny\"','Helps to prevent <a href=\'http://en.wikipedia.org/wiki/Clickjacking\'>clickjacking</a> where an attacker covers your site underneath another site so that visitors are unknowingly manipulating your site.','<ul>\r\n<li><a href=\"http://michael-coates.blogspot.com/2010/08/x-frame-option-support-in-firefox.html\">A comprehensive blog about x-frame-options</a></li>\r\n\r\n<li><a href=\"https://developer.mozilla.org/en/The_X-FRAME-OPTIONS_response_header\">Mozilla developer\'s x-frame-options</a></li>\r\n\r\n<li><a href=\"http://en.wikipedia.org/wiki/Clickjacking\">Wikipedia page on clickjacking and x-frame-options</a></li>\r\n\r\n<li><a href=\"https://www.owasp.org/index.php/Clickjacking\">Clickjacking by OWASP</a></li>\r\n</ul>'),(2,'set_cookie_httponly','Set-Cookie: HTTPOnly','Cookie Protection','Makes Javascript unable to read cookies.','Set HTTP Response Header: \"Set-Cookie: HTTPOnly\"\r\n\r\n<p />\r\nIn settings, set <code>SESSION_COOKIE_HTTPONLY = True</code>. Read the <a href=\"https://docs.djangoproject.com/en/dev/topics/http/sessions/#session-cookie-httponly\">docs for more info</a>.\r\n\r\n<p />\r\nAlso read playdoh\'s <a href=\"http://playdoh.readthedocs.org/en/latest/bestpractices.html#mmmmh-cookies\">cookie settings</a>.','Prevents attackers from reading your cookies in an XSS attack.','<ul>\r\n<li><a href=\"https://www.owasp.org/index.php/HttpOnly\">OWASP page on HTTPOnly</a></li>\r\n<li><a href=\"http://www.google.com/search?q=httponly\">Google results</a></li>\r\n</ul>'),(3,'parameterized_sql','Parameterized SQL Statements','Input Validation','Prevent SQL injections by parameterized SQL statements.','Don\'t want Little Bobby Tables.\r\n\r\n<a href=\"https://docs.djangoproject.com/en/dev/topics/db/sql/#passing-parameters-into-raw\">Django does parameterized statements for you</a>, but if you don\'t use Django for web development, you can <a href=\"http://rosettacode.org/wiki/Parametrized_SQL_statement#Ruby\">see examples in different languages</a>.','SQL Injection, <a href=\"http://xkcd.com/327/\">Little Bobby Tables</a>','<ul>\r\n<li><a href=\"http://en.wikipedia.org/wiki/SQL_injection\">Wikipedia</a>\r\n<li><a href=\"http://www.google.com/search?q=sql+injection\">Google \"SQL Injection\"</a>\r\n</ul>'),(6,'richtext_and_safe_url','Richtext and Safe URL','Input Validation','Only allows certain html tags and makes sure url is safe.','<p>\r\nRichtext: Bleach only allows certain safe html tags so that potentially dangerous tags, such as \"script\", are always escaped.  This way, users can still have some freedom on creating fancy-looking text without having to worry about XSS.\r\n</p>\r\n\r\n<p>\r\n<br />Safe URL:Using Google\'s SafeBrowsing, we verify the URL to make sure that it\'s not malicious. We also verify for all HTTPS urls that the there is not a MITM attack by checking\r\n<br />\r\n<br />1. Checking that a certificate of the Google SafeBrowing url\'s hostname matches the name on the certificate\r\n<br />2. Checking that the certificate is not expired.\r\n<br />3. Checking that the CAs are valid.\r\n</p>','XSS, \r\nClicking on Malicious links','<ul>\r\n<li><a href=\"http://code.google.com/apis/safebrowsing/lookup_guide.html\">Google Safe Browsing</a></li>\r\n<li><a href=\"https://github.com/jsocol/bleach/\">bleach</a></li>\r\n</ul>'),(8,'good_auth','Good Authentication','Authentication','Use bcrypt with HMAC, ratelimt with ReCaptcha','<p>Bcrypt</p>\r\n\r\n<p>Ratelimit</p>','Password attacks','To add later'),(9,'csp','Content Security Policy','Content Security Policy','Externalize Javascript','First line of defense against XSS','XSS.','google it yourself'),(10,'accesscontrol','Access Control','Access Control','Access Control','Access Control','Unwanted access control','Decorators:\r\n<ul>\r\n<li><a href=\"http://uswaretech.com/blog/2009/06/understanding-decorators/\">Understanding Decorators</a></li>\r\n<li><a href=\"http://passingcuriosity.com/2009/writing-view-decorators-for-django/\">Writing Decorators</a></li>\r\n</ul>'),(11,'fileupload','File Upload','File Upload','File Upload','File Upload. More specifically, image upload.','bad stuff','google it yourself.');
